import {
  Container,
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Head from "next/head";
import SEO from "react-seo-component";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";
// Layout
import Layout from "../../../components/Layout";
import OralsLayout from "../../../orals-components/OralsLayout";
import { Tabs, Tab } from "react-bootstrap";

var today = new Date();
var dd = String(today.getDate()).padStart(2, "0");
var mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
var yyyy = today.getFullYear();

today = mm + "/" + dd + "/" + yyyy;

console.log(today);

const School = props => (
  <Layout>
    <SEO
      title={"School - Oral Practice | CXC Spanish Online"}
      pathname={"https://www.cxcspnish/mailing-list"}
      description={
        "Learn to talk about school in Spanish. Practice speaking with our CXC Spanish online guide."
      }
      siteLanguage={"en"}
      twitterUsername={"_rxheem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={today}
      modifiedDate={today}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/orals">Orals</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/orals">Conversation</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>School</BreadcrumbItem>
      </Breadcrumb>

      <OralsLayout>
        <Card>
          <MobileView>
            <CardImg
              style={{ width: "100%" }}
              alt="image of students"
              src="https://images.all-free-download.com/images/graphiclarge/students_icons_modern_colored_cartoon_characters_6837733.jpg"
            />
          </MobileView>
          <CardBody>
            <CardTitle>School</CardTitle>

            <br />
            <Tabs defaultActiveKey="2006">
              <Tab eventKey="2006" title="May 2006">
                <br />
                <div></div>
              </Tab>
              <Tab eventKey="2007" title="May 2007">
                <br />
                <div></div>
              </Tab>
              <Tab
                className={isMobile ? "invisible" : null}
                eventKey="2008"
                title="June 2008"
              >
                <br />
                <div></div>
              </Tab>
            </Tabs>
          </CardBody>
        </Card>
      </OralsLayout>
    </Container>
  </Layout>
);

export default School;
